import Task from "./Task";
import { FaArrowUp } from "react-icons/fa";
const ShortTasks = ({ tasks, onDelete, onToggle }) => {
  return (
    <>
      <div style={{ align: "right" }}>
        <FaArrowUp style={{ align: "center" }} />
      </div>
      {tasks.map(
        (task) =>
          task.type === "short" && (
            <Task
              key={task.id}
              task={task}
              onDelete={onDelete}
              onToggle={onToggle}
            ></Task>
          )
      )}
    </>
  );
};

export default ShortTasks;
